import React from "react";

function Math() {


    Addition = (num1, num2) => {
    return num1 + num2;
  };

  Subtract = (num1, num2) => {
    return num1 - num2;
  };

  Multiply = (num1, num2) => {
    return num1 * num2;
  };

  Divide = (num1, num2) => {
    return num1 / num2;
  };
}

export default Math;
